import React from 'react'

var Siv = ()=>{
    var title = 'Chodavaram'
return  
   ( <div>
        <h1>{title}</h1>
        <p>{Content}</p>
        <Vis/> <Sai/>
    </div>
   )
}
export default Siv
var Vis = ()=>{
    var title = 'Ramachandrapuram',Content ='Ramachandrapuram is a town in East Godavari district of the Indian state of Andhra Pradesh. The town is a Municipality which serves as the headquarters of Ramachandrapuram mandal and Ramachandrapuram revenue division.'
return 
    (<div>
        <h1>{title}</h1>
        <p>{Content}</p>
    </div>
)
}

var Sai = ()=>{
    var title = 'East godavari',Content ='East Godavari is a district in the Coastal Andhra region of Andhra Pradesh, India. Its district headquarters is at Kakinada. As of Census 2011, it became the most populous district of the state with a population of 5,151,549.'
return 
    (<div>
        <h1>{title}</h1>
        <p>{Content}</p>
    </div>
    )
}
